import React from "react";

import { Card, Avatar } from "antd";
import {
  EditOutlined,
  EllipsisOutlined,
  SettingOutlined,
} from "@ant-design/icons";

const { Meta } = Card;

export function IntroCard(props) {
  return (
    <div className="cardBox">
      <div className="iconBox">
        <img src={props.icon} className="icon" />
      </div>
      <div className="cardTitle">{props.title}</div>
      <div className="cardIntro">{props.intro}</div>
    </div>
  );
}

export function CategoryCard(props) {
  return (
    <div
      className="cardBox2 col-lg-3 col-sm-5 m-2"
      style={{
        backgroundImage:
          "linear-gradient(rgba(0, 0, 0, 0.426), rgba(0, 0, 0, 0.426)),url(" +
          props.bg +
          ")",
      }}
    >
      <div style={{ marginTop: "auto" }}>
        <div className="cardTitle2">{props.title}</div>
        <div className="cardIntro2">{props.para}</div>
        <div
          className="btn mt-1"
          onClick={() => console.log("Show me clicked")}
        >
          Shop Now
        </div>
      </div>
    </div>
  );
}

export function ItemCard() {
  return (
    <div>
      <Card
        style={{
          width: 300,
          border: "1px solid black",
          borderRadius: "10px",
          overflow: "hidden",
          backgroundColor: "lightgoldenrodyellow",
        }}
        cover={
          <img
            className="itemImg"
            alt="example"
            src="https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1584477049-best-jeans-4-1584477027.jpg?crop=1xw:1xh;center,top&resize=480%3A%2A"
          />
        }
        actions={[
          <SettingOutlined key="setting" />,
          <EditOutlined key="edit" />,
          <EllipsisOutlined key="ellipsis" />,
        ]}
      >
        <Meta title="Denim Brand Jeans" description="â‚¹500" />
      </Card>
      ,
    </div>
  );
}
